script: |
  super -f tsv -I q10140.sql | sort > q10140.out

vector: true

inputs:
  - name: q10140.sql
    data: |
      SELECT + - ( - - CAST ( 16 AS INTEGER ) ) FROM tab0 AS cor0 WHERE col1 NOT BETWEEN + - 26 * - 29 AND col1 * - col0 * - 84;
  - name: tab0

outputs:
  - name: q10140.out
    data: |
      -16
      -16
      -16
